import React from 'react'
import { Switch, Route } from 'react-router-dom'

import CataloguePage from './pages/cataloguepage.js';


const Router = () => (
	<Switch>
		<Route exact path='/' component={CataloguePage} />
	</Switch>
)
export default Router
